import React from 'react';
import '../App.scss';

const Menu = (props) => {
    return (
      <div className="Menu">
        <nav>
            <ul>
                <li><a>S'identifer</a></li>
                <li><a>S'enregistrer</a></li>
            </ul>
        </nav>
      </div>
    );
}

export default Menu;
